import React from 'react';
import './NavBar.css';

function NavBar() {
  return (
    <nav className="NavBar">
      <ul>
        <li><a href="#Introduction">Home</a></li>
        <li><a href="#About">About</a></li>
        <li><a href="CodingProjects">Projects</a></li>
        <li><a href="#ProductPortfolio">Products</a></li>
        <li><a href="#Resume">Products</a></li>
        <li><a href="#Contact">Contact</a></li>
      </ul>
    </nav>
  );
}

export default NavBar;
